The reference implementation will serve queries and mutations based on in-memory data read from CSV files. First, we will define some types to represent the data in the CSV files. The structure of these types will also be reflected in our data connector's schema: type Row = HashMap<String, serde_json::Value>; Our data connector's application state will consist of collections of each of these types: #[derive(Debug, Clone)]
pub struct AppState { pub articles: Vec<Row>, pub authors: Vec<Row>, pub metrics: Metrics,
} In our main function, the data connector reads the initial data from the CSV files, and creates the AppState, before starting a web server with the required endpoints: #[tokio::main]
async fn main() { let app_state = Arc::new(init_app_state()); let app = Router::new() .route("/healthz", get(get_healthz)) .route("/metrics", get(get_metrics)) .route("/capabilities", get(get_capabilities)) .route("/schema", get(get_schema)) .route("/query", post(post_query)) .route("/mutation", post(post_mutation)) .route("/explain", post(post_explain)) .layer(axum::middleware::from_fn_with_state( app_state.clone(), metrics_middleware, )) .with_state(app_state); // run it with hyper on localhost:8100 axum::Server::bind(&"0.0.0.0:8100".parse().unwrap()) .serve(app.into_make_service()) .await .unwrap();
} In the next chapters, we will look at the implementation of each of these endpoints in turn.

