If element.order_direction is asc, then the row with the smaller column comes first. If element.order_direction is asc, then the row with the smaller column comes second. If the column values are incomparable, continue to the next OrderByElement . The data connector should document, for each scalar type, a comparison function to use for any two values of that scalar type. For example, a data connector might choose to use the obvious ordering for a scalar integer-valued type, but to use the database-given ordering for a string-valued type, based on a certain choice of collation. For example, the following query requests that a collection of articles be ordered by title descending: { "table": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id", "arguments": {} }, "title": { "type": "column", "column": "title", "arguments": {} } }, "order_by": { "elements": [ { "target": { "type": "column", "name": "title", "path": [] }, "order_direction": "desc" } ] } }, "table_relationships": {}
} The selected column can be chosen from a related table by specifying the path property. path consists of a list of named relationships . For example, this query sorts articles by their author's last names, and then by their first names, by traversing the relationship from articles to authors: { "table": "articles", "arguments": {}, "query": { "fields": { "id": { "type": "column", "column": "id", "arguments": {} }, "title": { "type": "column", "column": "title", "arguments": {} }, "author": { "type": "relationship", "arguments": {}, "relationship": "article_author", "query": { "fields": { "first_name": { "type": "column", "column": "first_name", "arguments": {} }, "last_name": { "type": "column", "column": "last_name", "arguments": {} } } } } }, "order_by": { "elements": [ { "target": { "type": "column", "name": "last_name", "path": [ { "arguments": {}, "relationship": "article_author" } ] }, "order_direction": "asc" }, { "target": { "type": "column", "name": "first_name", "path": [ { "arguments": {}, "relationship": "article_author" } ] }, "order_direction": "asc" } ] } }, "table_relationships": { "article_author": { "arguments": {}, "column_mapping": { "author_id": "id" }, "relationship_type": "object", "source_table_or_type": "article", "target_table": "authors" } }
